description:
🇬🇧Заявления премьера Великобритании Риши Сунака:

▪️Действия оси авторитарных стран - Ирана, России, Северной Кореи и Китая - с ценностями, отличающимися от наших, всё более агрессивны;

▪️Эти страны и их прокси вызывают всё больше нестабильности во всё большем количестве мест одновременно;

▪️Есть те, кто думает, что это далёкие от нас проблемы, но это не так, они напрямую угрожают безопасности и процветанию Соединённого Королевства;

▪️Россия уже травила людей химическим оружием на территории Англии, она предоставляет Ирану технологии взамен на оружие. Я лично видел, какие разрушения «Шахеды» причиняли в Украине;

▪️Иран с помощью прокси нападает на наши суда в Красном Море, которые доставляют необходимые товары;

▪️Северная Корея поставляет оружие России, а её хакеры атакуют британские предприятия;

▪️Китай проводит большую модернизацию своих войск, создавая потенциальный очаг напряжённости в Индо-Тихоокеанском регионе, который может повлиять на экономику сильнее, чем эпидемия COVID-19;

▪️Новая агрессия авторитарных стран, далёких от наших берёгов, должна быть принята во внимание, поскольку они объединились против наших фундаментальных ценностей: демократии, свободы и верховенства закона.

▪️Британия переведёт свою оборонную промышленность в режим военного времени, — премьер Великобритании Сунак.

Также он заявил о намерение Лондона нарастить оборонные расходы до 2,5% ВВП к 2030 году: за 6 лет британские власти дополнительно инвестируют в ВПК 75 миллиардов фунтов.

🤡 Какую чушь несёт этот человек
